First install Pygments . Then save lean4.py , which contains an version of the Lean highlighter updated for Lean 4, and the following sample LaTeX file test.tex into the same directory: \documentclass{article}
\usepackage{fontspec}
% switch to a monospace font supporting more Unicode characters
\setmonofont{FreeMono}
\usepackage{minted}
% instruct minted to use our local theorem.py
\newmintinline[lean]{lean4.py:Lean4Lexer -x}{bgcolor=white}
\newminted[leancode]{lean4.py:Lean4Lexer -x}{fontsize=\footnotesize} \begin{document}
% some example options
\begin{minted}[mathescape, linenos, numbersep=5pt, frame=lines, framesep=2mm]{Lean}
theorem funext {f₁ f₂ : ∀ (x : α), β x} (h : ∀ x, f₁ x = f₂ x) : f₁ = f₂ := by show extfunApp (Quotient.mk f₁) = extfunApp (Quotient.mk f₂) apply congrArg apply Quotient.sound exact h
\end{minted}
\end{document} You can then compile test.tex by executing the following command: xelatex --shell-escape test.tex Some remarks: either xelatex or lualatex is required to handle Unicode characters in the code. --shell-escape is needed to allow xelatex to execute pygmentize in a shell. If the chosen monospace font is missing some Unicode symbols, you can direct them to be displayed using a fallback font or other replacement LaTeX code. \usepackage{newunicodechar}
\newfontfamily{\freeserif}{DejaVu Sans}
\newunicodechar{✝}{\freeserif{✝}}
\newunicodechar{𝓞}{\ensuremath{\mathcal{O}}} minted has a "helpful" feature that draws red boxes around characters the chosen lexer doesn't recognize. Since the Lean lexer cannot encompass all user-defined syntax, it is advisable to work around this feature.

